        // Find the Distinc Number 
        function distinc(number1) {
            var k=1;
            for (var i = 0; i <= number1.length - 1; i++) {
                for (var j = 0; j <i; j++) {

                    if (number1[i] == number1[j]) {
                        break;
                    }
                    if (i==j) {
                        
                        return k++;
                    }

                }
                return k;

            }
             let number1 = [10, 20, 10, 20, 30, 40, 50];
